import React from "react";
import { Text } from "../components";

const DashboardCardTwo = ({ icon, title, number, bgColor }) => {
  return (
    <section className="md:pb-4 rounded-md min-w-[280px] md:min-w-0 md:w-[23%] flex mr-8">
      <div
        className={`flex p-4 rounded-tl-md rounded-bl-md`}
        style={{ backgroundColor: bgColor }}
      >
        <img src={icon} alt="icon" />
      </div>

      <div className="bg-white pt-5 md:pt-6 w-full h-full rounded-tr-md rounded-br-md pl-4 lg:pl-2 2xl:pl-6">
        <Text type="body2" className="lg:h-10">
          {title}
        </Text>
        <Text type="h7" className="pb-5 lg:pb-2 2xl:pb-6">
          {number}
        </Text>
      </div>
    </section>
  );
};

export { DashboardCardTwo };
